import React from 'react';
import Header from "./Header";
import Carusel from "./Carousel";
import BlogCards from "./BlogCards";
import Footer from "./Footer";
 const Blog = () => {
   return ( 
     <div>
       <h1>Блог</h1>
       <Header />
       <Carusel />
       <BlogCards />
       <Footer />
     </div>
    );
 }
  
 export default Blog;
